import React, { Component } from "react";
import Layout from "../components/Layout";
import { Segment } from "semantic-ui-react";

class index extends Component {
  render() {
    return (
      <Layout>
        <Segment
          color="black"
          style={{
            margin: "",
            padding: "20px 0 0 0",
            position: "absolute",
            width: "100%",
            height: "38%",
            bottom: "-20px",
          }}
        ></Segment>
      </Layout>
    );
  }
}

export default index;
